import logo from './logo.svg';
import './App.css';

function App() {
  const query = `{
    "data": {
      "pageCollection": {
        "items": [
          {
            "title": "Test - React + Contentful ",
            "logo": {
              "url": "https://images.ctfassets.net/gah1iulwmgz2/1mWqZX7TZZ33XTEfEsWzhk/41a74e6a4c1f8e0100e4b8b0744d8720/gay-logo.png"
            }
          }
        ]
      }
    }
  }`
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Dupa cyce
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
